def create_relation(first_id, category_brands)
    # (i = first_id)
  category_brands.each do |name|
    if name.slice(0) === BrandGroup.find(first_id).name
        name_id = Brand.find_by(name: name).id
        Relation.create(brand_group_id: first_id, brand_id: name_id)
    else
        first_id += 1
        name_id = Brand.find_by(name: name).id
        Relation.create(brand_group_id: first_id, brand_id: name_id)
    end
  end
end

